<html>
  <head>
    <style>
      body{
        font-family: monospace;
        width: 100%;
        height: 100%;
        margin: 0;
        overflow: hidden;
        background: #0d0d0d;
        color: #eee;
      }
      input{
        background-color: rgba(255, 255, 255, 0.3);
        border: 1px solid rgba(255, 255, 255, 0.3);
        color: #eee;
        border-radius: 8px;
      }
      textarea{
        background-color: rgba(255, 255, 255, 0.3);
        border: 1px solid rgba(255, 255, 255, 0.3);
        color: #eee;
        border-radius: 8px;
      }
      .main-container{
        display: inline-block;
        margin: 0 50%;
        transform: translate( -50%, 0 );
        width: 904px;
        padding: 5px;
        background-color: rgba(50, 50, 50, 0.8);
      }

      .copy_to_clipboard{
        border: 1px solid #888;
        border-radius: 4px;
        background: #ccc;
        position: relative;
        margin-left: 10px;
        cursor: pointer;
        width: 20px;
        left: -5px;
        float: right;
      }
      .copy_to_clipboard:hover {
        color: #ff5500;
      }
      .copy_to_clipboard:active {
        color: #ff5500;
      }

      #a_list{
        padding: 5px 25px;
      }
      a {
        color: #eee;
        clear: left;
        display: block;
        margin-top: 15px;
      }
      a:hover {
        color: #ff5500;
      }
      a:active {
        color: #ff5500;
      }
      
      .inline_menu_item {
        color: #eee;
        clear: left;
        display: inline-block;
        margin: 5px 5px 5px 5px;
        cursor: pointer;
      }
      .inline_menu_item:hover {
        color: #ff5500;
      }
      .inline_menu_item:active {
        color: #ff5500;
      }


      .left_panel{
        padding-left: 10px;
        width: 280px;
        display: inline-block;
        float: left;
      }
      .right_panel{
        width: 980px;
        display: inline-block;
        float: left;
        position: relative;
      }
      #styles_slider{
        width: 100%;
        height: 800px;
        overflow-y: scroll;
      }

      #styles_slider .item{
        width: 186px;
        margin: 3px ;
        display: inline-block;
        cursor: pointer;
        position: relative;
      }
      
      #styles_slider .item.mixed{ 
        box-shadow: 0 0 4px 4px #ee00ff;
        border-radius: 8px;
      }

      #styles_slider .item img{
        width: 100%;
        height: 230px;
        border-radius: 8px;
      }

      #styles_slider .item_name{
        position: absolute;
        bottom: 10px;
        left: 10px;
        font-size: 16px;
        text-shadow: 2px 3px 1px BLACK, 1px 0px 6px BLACK;
      }

      /* Стилізація для Chrome, Safari, Edge */
      /* Весь скроллбар */
      #styles_slider::-webkit-scrollbar {
          width: 12px;
      }

      /* Трек (фон скроллбару) */
      #styles_slider::-webkit-scrollbar-track {
          background: #f1f1f1;
          border-radius: 10px;
      }

      /* Повзунок (слайдер) */
      #styles_slider::-webkit-scrollbar-thumb {
          background-color: #888;
          border-radius: 10px;
          border: 3px solid #f1f1f1; /* Відстань між слайдером та краями */
      }

      /* При наведенні миші */
      #styles_slider::-webkit-scrollbar-thumb:hover {
          background-color: #555;
      }

      /* Для Firefox */
      #styles_slider {
          scrollbar-width: thin; /* Тонкий скроллбар */
          scrollbar-color: #888 #f1f1f1; /* Колір: слайдер і трек */
      }

      .board_section{
        display: inline-block; 
        float: left; 
        margin-left: 5px;
        margin-bottom: 10px;
      }

      small{
        font-size: 10px;
        color: #777;
      }

      .hidden{
        visibility: hidden;
        height: 0px;
      } 

      #tab_add_new_style textarea{
        width: 500px;
        height: 80px;
      } 

      .remove_icon{
        position: absolute;
        top: 0px;
        right: 10px;
        font-size: 16px;
        font-weight: bold;
      }

      img.place_before{
        border-left: 1px solid #ff5500;
      }

      #selected_style_name {
        text-shadow: 3px 4px 0px #000;
      }

      .style_mixer_checkbox{
        position: absolute;
        top: 4px;
        left: 4px;
        font-size: 16px;
        font-weight: bold;
        cursor: pointer;
      }

      .sub_navbar{

      }

      .sub_navbar span{
        cursor: pointer;
      }
      .sub_navbar span:hover *{
        color: #ff5500;
      }
      .sub_navbar span:active *{
        color: #ff5500;
      }

      .sub_navbar span.active {
        border-bottom: 1px solid #ff5500;
      }
    </style>
  </head>
